import React, { Component } from 'react';
import axios from 'axios';
import { Tab, Tabs, TabList, TabPanel } from 'react-tabs';
import HTML5Backend from 'react-dnd-html5-backend';
import { DragDropContext } from 'react-dnd';
import Plant from './Plant';
import Rock from './Rock';
import Decoration from './Decoration';
import Fish from './Fish';
import Target from './Target';
import FishTarget from './FishTarget';
import './quote.css';
import './plants.css';
import './rocks.css';
import './decorations.css';
import './fish.css';
import './target-container.css';
import './fish-target-container.css';

class Quoting extends Component {
    constructor(props) {
        super(props);
        this.state = {
            fishBowls: [],
            selectedFishBowl: null,
            water: [],
            selectedWater: null,
            floor: [],
            selectedFloor: null,
            products: [],
            plant: [],
            rock: [],
            decoration: [],
            fish: [],
            step: 0,
            setTarget: [],
            setFishTarget: [],
            selectedPlants: [],
            selectedRocks: [],
            selectedDecorations: [],
            selectedFish: [],
        };
    }

    componentWillMount() {
        //get fishBowls
        axios.get(`http://api.mipecera.kimosolutions.com/api/step/1`, {
            headers: {
                "Content-Type": "application/json",
